import { useState } from "react"; 
const ToDoList = () => {
    const[value,setValue]=useState("");
     
    const submitHandler=(e)=>{
        e.preventDefault();
        console.log(value);
        setValue("");
    }

    return (
        <div>
            <h3>To Do List</h3>
            <form onSubmit={submitHandler}>
                <input type="text" value={value} onChange={(e)=>setValue(e.target.value)}/>
                <button>Add</button>
            </form>
        </div>
     );
}
 
export default ToDoList;
